const Profile = () => {
  const [selectedStudent, setSelectedStudent] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');

  const handleStudentClick = (student) => {
    setSelectedStudent(student);
  };

  const filteredStudents = studentsData.filter((student) =>
    student.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="profile-container">
      <h1 className="header">Student Profiles</h1>
      <div className="search-container">
        <input
          type="text"
          className="search-bar"
          placeholder="Search student by name..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      <div className="content">
        <div className="student-list">
          {filteredStudents.length > 0 ? (
            filteredStudents.map((student) => (
              <div
                key={student.id}
                className={`student-item ${selectedStudent?.id === student.id ? 'active' : ''}`}
                onClick={() => handleStudentClick(student)}
              >
                {student.name}
              </div>
            ))
          ) : (
            <p>No students found</p>
          )}
        </div>

        <div className="student-details">
          {selectedStudent ? (
            <>
              <img src={selectedStudent.image} alt={selectedStudent.name} className="student-image" />
              <h2>{selectedStudent.name}</h2>
              <p><strong>Student ID:</strong> {selectedStudent.studentId}</p>
              <p><strong>Age:</strong> {selectedStudent.age}</p>
              <p><strong>Course:</strong> {selectedStudent.course}</p>
              <p><strong>Email:</strong> {selectedStudent.email}</p>
              <p><strong>Phone:</strong> {selectedStudent.phone}</p>
              <p><strong>Address:</strong> {selectedStudent.address}</p>
              <p><strong>GPA:</strong> {selectedStudent.gpa}</p>
              <p><strong>Performance:</strong> {selectedStudent.performance}</p>
              <button className="performance-btn">View Performance Insights</button>
            </>
          ) : (
            <p className="placeholder-text">Please select a student to view details.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Profile;
